import React from "react";
import Header from "./components/Header";
import Navbar from "./components/Navbar";

function App() {
  return (
    <div>
      <Header />
      <Navbar />
      <section className="FrontImage">
        <img src="src/assets/illustrations/Home_01.jpg"></img>
      </section>
      
    </div>
  );
}

export default App;
